import React, { useEffect, useState } from "react";
import { Link } from "react-router-dom";
import {
  HeaderWrapper,
  Logo,
  HeaderItemBar,
  Headernav,
  HeaderLogin,
  HeaderBtn,
  Stick,
  Wrapper,
  ProfileBtn,
} from "./HeaderStyle";


const Header = () => {
  return (
    <>
      <HeaderWrapper>
        <Wrapper>
        <Logo>CGV</Logo>
        <HeaderItemBar>
          <Headernav>상영정보</Headernav>
          <Headernav>상영정보</Headernav>
          <Headernav>상영정보</Headernav>
          <Headernav>
          <HeaderLogin>로그인</HeaderLogin>
          </Headernav>
        </HeaderItemBar>
      </Wrapper>
      </HeaderWrapper>
    </>
  );
};

export default Header;
